import styled from "styled-components";

const Input = styled.input`
  padding: 20px;
  color: ${({ theme }) => theme.colors.primary};
  background-color: ${({ theme }) => theme.colors.primaryLight};
  border: 0;
  border-radius: 10px;
`;

export default function InputComponent(props) {
  return <Input {...props} />;
}
